import {Div, Group, Placeholder, Separator, Spacing} from "@vkontakte/vkui";
import * as PropTypes from "prop-types";

function Sell(props) {
    return null;
}

Sell.propTypes = {children: PropTypes.node};

function Frame(props) {

    let ItemFrameElements = defState.itemList.map( elItem => {
        return(
            <ItemFrame id={elItem.id} name={elItem.name} price={elItem.price} imgItem={elItem.imgItem}/>
        )
    })

    return (
      // <div className={style.frame}>
