      //         {ItemFrameElements}
      //     </div>
      // </div>
        <div>
            <div className={style.frame_text_head}>Одежда</div>
            <div style={{display:'flex',flexWrap: 'wrap', alignItems: 'center', padding: '10px 0 10px 11px', }}>
                {ItemFrameElements}
            </div>
        </div>
    )
    }

export default Frame;
